#include <iostream>

using namespace std;

int main(){
    int n;
    cin >> n;

    // record the time to run the program
    clock_t start, end;
    start = clock();

    // create an array of size 100
    int arr[100] = {0};
    while(n--){
        int temp;
        cin >> temp;
        arr[temp]++;
    }

    for(int i = 0; i < 100; i++){
        while(arr[i]--){
            cout << i << " ";
        }
    }
    end = clock();
    cout << endl << "Time taken: " << (double)(end - start) / CLOCKS_PER_SEC << endl;
}

